    const ToolbarMenu :  React.FC<{}> = () => {
      const classes = useStyles();
      const theme = useTheme();
    return (


          <Toolbar style={{backgroundColor:"white",color:"black"}}>
             <Grid container spacing={3}>
             <Grid item xs={2}>
              <img src={logo} style={{height:"40px"}} alt="logo" />
           </Grid>
           <Grid item xs={8}>

          <div className={classes.search}>
            <div className={classes.searchIcon}>
              <SearchIcon />
            </div>
            <InputBase className={classes.textSearch}
              placeholder="Search…"
              classes={{
                root: classes.inputRoot,
                input: classes.inputInput,
              }}
              inputProps={{ 'aria-label': 'search' }}
            />
 <Select className={classes.comboSearch}
          native


          inputProps={{
            name: 'age',
            id: 'age-native-simple',
          }}
        >
          <option aria-label="None" value="" />
          <option value={1}>Candidate</option>
          <option value={2}>Twenty</option>
          <option value={3}>Thirty</option>
        </Select>

          </div>
           </Grid>
           <Grid item >
           <NotificationsNoneIcon style={{marginTop:'8px'}} />
           </Grid>
           <Grid item  style={{marginTop:'10px'}}>
           <label  >Jonathan</label>
           </Grid>

            <Grid item>

                <Avatar src="/static/images/avatar/1.jpg" alt="My Avatar" />

           </Grid>
           <Grid item>

           <IconButton aria-label="display more actions" edge="end" color="inherit">
            <MoreVertIcon />
          </IconButton>

       </Grid>

          </Grid>


        </Toolbar>

    );


}

export default ToolbarMenu;
